  const navigate = useNavigate();
  const { id } = useParams();
  const diaryList = useContext(DiaryStateContext);

  useEffect(() => {
    if (diaryList.length >= 1) {
      const targetDiary = diaryList.find(
        (it) => parseInt(it.id) === parseInt(id),
      );
    }
    if (targetDiary) {
    } else {
      navigate("/", { replace: true });
    }
  }, [id, diaryList]);
  return (
    <div className="Edit">
      <h2>Edit</h2>
    </div>
  );
};
export default Edit;
